import React from 'react';
import AboutMe from './AboutMe';
import cchcover from './cchcover.jpg'

function About(){
    return(
        <>
            <AboutMe />
            <h1>Suzanne August</h1>
            <ul>
                <img src={cchcover}/>
            </ul>
        </>
    );
}

export default About;
